import { SurveyPDF } from '../src/survey';
import { IRect, DocController } from '../src/doc_controller';
import { FlatSurvey } from '../src/flat_layout/flat_survey';
import { FlatHTML } from '../src/flat_layout/flat_html';
import { FlatSignaturePad } from '../src/flat_layout/flat_signaturepad';
import { IPdfBrick } from '../src/pdf_render/pdf_brick';
import { SurveyHelper } from '../src/helper_survey';
import { TestHelper } from '../src/helper_test';
import { CompositeBrick } from '../src/pdf_render/pdf_composite';
import { HTMLBrick } from '../src/pdf_render/pdf_html';
import { QuestionSignaturePadModel } from 'survey-core';
let __dummy_sp = new FlatSignaturePad(null, null, null);

const SIGNATURE_VALUE = 'data:image/png;base64,';

test('Check signaturepad', async () => {
    SurveyHelper.shouldConvertImageToPng = false;
    let json: any = {
        questions: [
            {
                type: 'signaturepad',
                name: 'sigpadque',
                titleLocation: 'hidden',
                defaultValue: SIGNATURE_VALUE
            }
        ]
    };
    let survey: SurveyPDF = new SurveyPDF(json, TestHelper.defaultOptions);
    let controller: DocController = new DocController(TestHelper.defaultOptions);
    let flats: IPdfBrick[][] = await FlatSurvey.generateFlats(survey, controller);
    expect(flats.length).toBe(1);
    expect(flats[0].length).toBe(1);
    expect(flats[0][0] instanceof CompositeBrick).toBeTruthy();
    expect((<CompositeBrick>flats[0][0])['bricks'].length).toBe(1);
    const htmlBrick = (<CompositeBrick>flats[0][0])['bricks'][0];
    expect(htmlBrick instanceof HTMLBrick).toBeTruthy();
    let assumeHTML: IRect = {
        xLeft: controller.leftTopPoint.xLeft + controller.unitWidth,
        xRight: controller.leftTopPoint.xLeft + controller.unitWidth +
            SurveyHelper.pxToPt((<any>survey.getAllQuestions()[0]).signatureWidth),
        yTop: controller.leftTopPoint.yTop,
        yBot: controller.leftTopPoint.yTop +
            SurveyHelper.pxToPt((<any>survey.getAllQuestions()[0]).signatureHeight)
    };
    TestHelper.equalRect(expect, htmlBrick, assumeHTML);
    SurveyHelper.shouldConvertImageToPng = true;
});

test('Check signaturepad with backgroundImage', async () => {
    SurveyHelper.shouldConvertImageToPng = false;
    let json: any = {
        questions: [
            {
                type: 'signaturepad',
                name: 'sigpadque',
                titleLocation: 'hidden',
                backgroundImage: 'backgroundImageUrl',
                defaultValue: SIGNATURE_VALUE
            }
        ]
    };
    let survey: SurveyPDF = new SurveyPDF(json, TestHelper.defaultOptions);
    let controller: DocController = new DocController(TestHelper.defaultOptions);
    let flats: IPdfBrick[][] = await FlatSurvey.generateFlats(survey, controller);
    expect(flats.length).toBe(1);
    expect(flats[0].length).toBe(1);
    expect(flats[0][0] instanceof CompositeBrick).toBeTruthy();
    expect((<CompositeBrick>flats[0][0])['bricks'].length).toBe(2);
    const backgroundImageBrick = (<CompositeBrick>flats[0][0])['bricks'][0];
    const htmlBrick = (<CompositeBrick>flats[0][0])['bricks'][1];
    expect(htmlBrick instanceof HTMLBrick).toBeTruthy();
    expect(backgroundImageBrick instanceof HTMLBrick).toBeTruthy();
    expect((<HTMLBrick>backgroundImageBrick)['html']).toBe("<img src='backgroundImageUrl' width='225' height='150'/>");
    let assumeHTML: IRect = {
        xLeft: controller.leftTopPoint.xLeft + controller.unitWidth,
        xRight: controller.leftTopPoint.xLeft + controller.unitWidth +
            SurveyHelper.pxToPt((<any>survey.getAllQuestions()[0]).signatureWidth),
        yTop: controller.leftTopPoint.yTop,
        yBot: controller.leftTopPoint.yTop +
            SurveyHelper.pxToPt((<any>survey.getAllQuestions()[0]).signatureHeight)
    };
    TestHelper.equalRect(expect, htmlBrick, assumeHTML);
    TestHelper.equalRect(expect, backgroundImageBrick, assumeHTML);
    SurveyHelper.shouldConvertImageToPng = true;
});

test('Check signaturepad getSignImageUrl', async () => {
    SurveyHelper.shouldConvertImageToPng = false;
    let json: any = {
        questions: [
            {
                type: 'signaturepad',
                name: 'signaturepad',
            }
        ]
    };
    const survey: SurveyPDF = new SurveyPDF(json, TestHelper.defaultOptions);
    const controller: DocController = new DocController(TestHelper.defaultOptions);
    const quesiton = survey.getQuestionByName('signaturepad') as QuestionSignaturePadModel;
    const flatSignature = new FlatSignaturePad(survey, quesiton, controller);
    quesiton.storeDataAsText = false;
    quesiton.value = 'some_url';
    quesiton['_loadedData'] = undefined;
    expect(flatSignature['getSignImageUrl']()).toBe('some_url');
    quesiton['_loadedData'] = 'some_url2';
    expect(flatSignature['getSignImageUrl']()).toBe('some_url2');

    quesiton.storeDataAsText = true;
    quesiton.value = 'some_url';
    quesiton['_loadedData'] = undefined;
    expect(flatSignature['getSignImageUrl']()).toBe('some_url');
    quesiton['_loadedData'] = 'some_url2';
    expect(flatSignature['getSignImageUrl']()).toBe('some_url');
});